perspectives.style:
@controls {
  bottom {
    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: stakeholder;
  theme: dark;
  element-scale: scale("StatusNum", 1, 2);
  //layout: static;
}

element {
  image-size: contain;
  image-visibility: visible;
  outline-offset: 0;
  shadow-opacity: 0;
  font-size: 30;
  font-family: Voltaire;
}

element {
  popover: "{{label}}";
}

element["Quote"] {
  popover: "<blockquote>{{quote}}</blockquote>";
}

element["Description"] {
  popover: "{{description}}";
}

element["Quote"]element["Description"] {
  popover: "<blockquote>{{quote}}</blockquote>{{description}}";
}

element["Image"] {
  popover: "{{image}}";
  popover-width: 800;
}

